import './App.css';
import { Routes, Route} from 'react-router-dom';
import IniciarApp from './componentes/IniciarApp';




function App() {
  return (
    <div className="App">

    <Routes>
      <Route path="/" element={<IniciarApp/>}></Route>
    </Routes>
    </div>
  );
}

export default App;
